import React, { Component } from 'react';
import logo from './logo.svg';
import { connect, sendMsg } from './api'
import Header from './component/Header/Header'
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    connect();
  }

  send() {
    console.log("hello");
    sendMsg("hello")
  }

  render() {
    return (
      <div className="App">
        <Header />
        <button onClick={this.send}>Hit</button>
      </div>
    )
  }

}

export default App;
